import React, { Component } from 'react'
import { Container, Table, Jumbotron, Button, Form } from 'react-bootstrap';

//import products from '../planilla/products'
class MarcaHora extends Component {
    constructor(...props) {
        super(...props);
        this.state = {
        }
    }
    onSubmit() {

    }
    render() {

        return (
            <>
                <div className="container">
                    <Form
                    // onSubmit={onSubmit}
                    >
                        <div className="form-group">
                            <input
                                type="text"
                                className="form-control"
                                placeholder="title"
                                name="title"
                            // onChange={onChange}
                            // value={form.title}
                            />
                        </div>
                        <div className="form-group">
                            <input
                                type="text"
                                className="form-control"
                                placeholder="description"
                                name="description"
                            // onChange={onChange}
                            // value={form.description}
                            />
                        </div>
                        <div className="form-group">
                            <input
                                type="text"
                                className="form-control"
                                placeholder="img"
                                name="img"
                            // onChange={onChange}
                            // value={form.img}
                            />
                        </div>
                        <div className="form-row">
                            <div className="col">
                                <input
                                    type="text"
                                    className="form-control"
                                    placeholder="leftColor"
                                    name="leftColor"
                                // onChange={onChange}
                                // value={form.leftColor}
                                />
                            </div>
                            <div className="col">
                                <input
                                    type="text"
                                    className="form-control"
                                    placeholder="rightColor"
                                    name="rightColor"
                                // onChange={onChange}
                                // value={form.rightColor}
                                />
                            </div>
                        </div>

                        <button
                            type="submit"
                            className="btn btn-primary float-right"
                        >
                            Submit
            </button>
                    </Form>
                    <Table striped bordered hover>
                        <thead>
                            <tr>
                                <th>Dia</th>
                                <th>Tipo horario</th>
                                <th>Fecha </th>
                                <th>Username</th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr>
                                <td>1</td>
                                <td>Mark</td>
                                <td>Otto</td>
                                <td>@mdo</td>
                            </tr>
                            <tr>
                                <td>2</td>
                                <td>Jacob</td>
                                <td>Thornton</td>
                                <td>@fat</td>
                            </tr>
                   
                        </tbody>
                    </Table>
                </div>
            </>
        )
    }
}
export default MarcaHora
